import '../sass/main.scss';
import Theme from'../utils/Theme'

// This default export is required in a new `pages/_app.js` file.
export default function MyApp({ Component, pageProps }) {
  return (
    <Theme>
      <div className="container">
        <Component {...pageProps} />
      </div>
    </Theme>
  )
}
